import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "../pages/home/Home";
import HappyStylers from "../pages/happyStylers/HappyStylers";

function Path() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/HappyStylers" element={<HappyStylers />} />
        <Route path="*" element={<div>404 Vuelve a Viladecans</div>} />
      </Routes>
    </BrowserRouter>
  );
}
export default Path;
